    "# Find the number of counties per state in the Far West region\n",
    "far_west_states <- values(state_hash, 'Far West')\n",
    "\n",
    "# HOld the county counts\n",
    "far_west_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (f in far_west_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    far_west_counties <- append(far_west_counties, length(which(df$STATE_ABBR == f)))\n",
    "}\n",
    "\n",
    "# Check\n",
    "far_west_counties"
   ]
