    "# Function to get total state gdp\n",
    "totalStateGDP <- function(region) {\n",
    "    # Hold the total state GDP values\n",
    "    total_state_gdp <- c()\n",
    "    # State list\n",
    "    region_states <- values(state_hash, region)\n",
    "    # Iterate\n",
    "    for (s in region_states) {\n",
    "        # Initialize county_gdps\n",
    "        county_gdps <- 0\n",
    "        # Get the list of indexes for the state counties\n",
    "        county_idx_list <- which(df$STATE_ABBR == s)\n",
    "        # Iterate through the list of indexes\n",
    "        for (c in county_idx_list) {\n",
    "            # Use column index because retrieval throws error for GDP (Chained $)\n",
    "            county_gdps <- county_gdps + df[, 8][c]\n",
    "        }\n",
    "        # Add county_gdps to total_state_gdp\n",
    "        total_state_gdp <- append(total_state_gdp, county_gdps)\n",
    "    }\n",
    "    # Return total_state_gdp\n",
    "    return(format(total_state_gdp, scientific = FALSE))\n",
    "}"
   ]
  },
