    "# Sub Regions: Far West\n",
    "far_west_map <- plot_usmap(regions = 'states', include = c('Alaska', 'Hawaii', 'California', 'Nevada', 'Oregon', 'Washington'), labels = TRUE, color = 'black', fill = 'blue', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "far_west_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(far_west_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "# View\n",
    "far_west_map + far_west_subtable"
   ]
