   "source": [
    "# Find the number of counties per state in the Great Lakes region\n",
    "great_lakes_states <- values(state_hash, 'Great Lakes')\n",
    "\n",
    "# HOld the county counts\n",
    "great_lakes_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (g in great_lakes_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    great_lakes_counties <- append(great_lakes_counties, length(which(df$STATE_ABBR == g)))\n",
    "}\n"
   ]
  },
