    "# Sub Regions: Great Lakes\n",
    "great_lakes_map <- plot_usmap(include = c(.east_north_central), labels = TRUE, color = 'black', fill = 'green', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "great_lakes_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(great_lakes_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "# View\n",
    "great_lakes_map + great_lakes_subtable"
   ]
  },
