    "# Find the number of counties per state in the Midwest region\n",
    "mideast_states <- values(state_hash, 'Mideast')\n",
    "\n",
    "# HOld the county counts\n",
    "mideast_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (m in mideast_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    mideast_counties <- append(mideast_counties, length(which(df$STATE_ABBR == m)))\n",
    "}"
   ]
  },
