    "# Sub regions: Mideast DC DE MD NJ NY PA\n",
    "mideast_map <- plot_usmap(regions = 'states', include = c('DC', 'DE', 'MD', 'NJ', 'NY', 'PA'), labels = TRUE, color = 'black', fill='orange', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "mideast_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(mideast_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "# View\n",
    "mideast_map + mideast_subtable"
   ]
