    "# Find the number of counties per state in the New England region\n",
    "newengland_states <- values(state_hash, 'New England')\n",
    "\n",
    "# HOld the county counts\n",
    "newengland_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (n in newengland_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    newengland_counties <- append(newengland_counties, length(which(df$STATE_ABBR == n)))\n",
    "}"
   ]
