    "# Sub Regions: New England CT MA ME NH RI VT\n",
    "new_england_map <- plot_usmap(regions = 'states', include = c('CT', 'MA', 'ME', 'NH', 'RI', 'VT'), labels = TRUE, color = 'black', fill = 'red', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "newengland_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(newengland_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "\n",
    "# View\n",
    "new_england_map + newengland_subtable"
   ]
  },
