   "source": [
    "# Find the number of counties per state in the Plains region\n",
    "plains_states <- values(state_hash, 'Plains')\n",
    "\n",
    "# HOld the county counts\n",
    "plains_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (n in plains_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    plains_counties <- append(plains_counties, length(which(df$STATE_ABBR == n)))\n",
    "}"
   ]
  },
