    "# Sub Regions: Plains\n",
    "plains_map <- plot_usmap(include = c(.west_north_central), labels = TRUE, color = 'black', fill = 'purple', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "plains_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(plains_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "# View\n",
    "plains_map + plains_subtable"
   ]
  },
