    "# Find the number of counties per state in the Rocky Mountain region\n",
    "rocky_mtn_states <- values(state_hash, 'Rocky Mountain')\n",
    "\n",
    "# HOld the county counts\n",
    "rocky_mtn_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (r in rocky_mtn_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    rocky_mtn_counties <- append(rocky_mtn_counties, length(which(df$STATE_ABBR == r)))\n",
    "}"
   ]
