   "source": [
    "# Sub Regions: Rocky Mountains CO ID MT UT WY\n",
    "rocky_mtn_map <- plot_usmap(regions = 'states', include = c('CO', 'ID', 'MT', 'UT', 'WY'), labels= TRUE, color = 'black', fill = 'deepskyblue3', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "rocky_mtn_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(rocky_mtn_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "# View\n",
    "rocky_mtn_map + rocky_mtn_subtable"
   ]
  },
