   "source": [
    "# Find the number of counties per state in the Rocky Mountain region\n",
    "se_states <- values(state_hash, 'Southeast')\n",
    "\n",
    "# HOld the county counts\n",
    "se_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (s in se_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    se_counties <- append(se_counties, length(which(df$STATE_ABBR == s)))\n",
    "}"
   ]
  },
