    "# Sub Regions: Southeast AL AR FL GA KY LA MS NC SC TN VA WV\n",
    "southeast_map <- plot_usmap(regions = 'states', include = c('AL','AR', 'FL', 'GA', 'KY', 'LA', 'MS', 'NC', 'SC', 'TN', 'VA', 'WV'), labels = TRUE, color = 'black', fill = 'chartreuse3', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "se_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(se_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "\n",
    "# View\n",
    "southeast_map + se_subtable"
   ]
  },
