   "source": [
    "# Find the number of counties per state in the Rocky Mountain region\n",
    "sw_states <- values(state_hash, 'Southwest')\n",
    "\n",
    "# HOld the county counts\n",
    "sw_counties <- c()\n",
    "\n",
    "# Iterate\n",
    "for (s in sw_states) {\n",
    "    # Count how many times state abbreviation appears\n",
    "    sw_counties <- append(sw_counties, length(which(df$STATE_ABBR == s)))\n",
    "}"
   ]
  },
