   "source": [
    "# Sub Regions: Southwest AZ NM OK TX\n",
    "southwest_map <- plot_usmap(regions = 'states', include = c('AZ', 'NM', 'OK', 'TX'), labels = TRUE, color = 'black', fill = 'thistle3', alpha = 0.35)\n",
    "\n",
    "# Create empty plot with table\n",
    "sw_subtable <- ggplot() +                             \n",
    "                      theme_void() +\n",
    "                      annotate(geom = \"table\",\n",
    "                               x = 1,\n",
    "                               y = 1,\n",
    "                               label = list(sw_tbl$`_data`))\n",
    "\n",
    "# Resize\n",
    "options(repr.plot.width = 15, repr.plot.height =12)\n",
    "\n",
    "\n",
    "# View\n",
    "southwest_map + sw_subtable"
   ]
